import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <!--The content below is only a placeholder and can be replaced.-->
    <div style="text-align:center" class="content">
      <h1>
        Welcome to {{title}}!
      </h1>
      <h2>ACCEPTANCE BRANCH</h2>
      <span style="display: block">{{ title }} app is running!</span>
      <img width="300" alt="Angular Logo" src="data:image/jpeg;base64,
">
    <p>{{lastFetchTime}}</p>
    <p *ngFor="let row of csvData.split('\n')" style="text-align:left">
      <code>
      {{row}}
      </code>
    </p>
    </div>
    <router-outlet></router-outlet>
  `,
  styles: []
})
export class AppComponent implements OnInit {
  title = 'Git Sample on Netlify';

  lastFetchTime = '';
  csvData = '';

  ngOnInit() {
     // Loading the jQuery code
    fetch(`https://docs.google.com/spreadsheets/d/e/2PACX-1vTEGksE78DKhE9n4_tM-1lt_-BaY9g1fOLyKuCBoNdRdKp1YpzeqVkP_I62aeMgr0Nagd790OVlkHmF/pub?gid=1070476763&single=true&output=csv&time=${Date.now()}`)
    .then((response) => {
      response.text().then((responseText) => {
        this.lastFetchTime = new Date().toString();
        this.csvData = responseText;
        console.log(responseText);
      });
    });
  }
}
